import React from 'react'
import './Categories.scss'

function Categories({ lists }) {



  return (
    <div className='categories' >
      <img src='img/logo.png' alt='logo' />
      <ul className='categories__list'>
        <li className='categories__item' >All</li>
        {lists.map(list =>
          <li key={list.id} className='categories__item' >{list.title}</li>
        )}
      </ul>
      <input className='categories__input' type="text" placeholder='New category' />
      <button className='button new ' >fgsdfgdfgd</button>
    </div>
  )
}

export default Categories
